import React from "react";
import "./Home.css";
import logo from './logo.png';
import meal from './meal.png';

function Home() {
    return (
        <div className="Image">
            <img className="logo" src={logo} alt="logo"
                height="160px" width="400" align="left"></img>
            <div className="Container">
                <img className="logo" src={logo} alt="logo"
                    height="160px" width="400" align="left"></img>
            </div>
        </div>
    );
}
export default Home;
